B.qh=A.a(s(["The best time to plant a tree was 20 years ago. The second best time is now.","Your time is limited, don't waste it living someone else's life.","The only way to do great work is to love what you do.","Believe you can and you're halfway there.","In the middle of difficulty lies opportunity.","The future belongs to those who believe in the beauty of their dreams.","It does not matter how slowly you go as long as you do not stop.","Everything you've ever wanted is on the other side of fear.","Success is not final, failure is not fatal: it is the courage to continue that counts.","The only impossible journey is the one you never begin.","What you get by achieving your goals is not as important as what you become.","Life is what happens when you're busy making other plans.","The purpose of our lives is to be happy.","Get busy living or get busy dying.","You only live once, but if you do it right, once is enough.","Many of life's failures are people who did not realize how close they were to success.","The way to get started is to quit talking and begin doing.","If life were predictable it would cease to be life, and be without flavor.","Life is really simple, but we insist on making it complicated.","The greatest glory in living lies not in never falling, but in rising every time we fall.","Your present circumstances don't determine where you can go; they merely determine where you start.","The secret of getting ahead is getting started.","Don't watch the clock; do what it does. Keep going.","Everything has beauty, but not everyone sees it.","The best revenge is massive success.","Life shrinks or expands in proportion to one's courage.","What lies behind us and what lies before us are tiny matters compared to what lies within us.","Happiness is not something ready made. It comes from your own actions.","If you want to live a happy life, tie it to a goal, not to people or things.","The mind is everything. What you think you become."]),t.s)
